import React from 'react'
import {ListGroup} from "react-bootstrap"

export default function User(props) {
    return (
        <ListGroup>
            <ListGroup.Item>
                Name: {props.user.name}
            </ListGroup.Item>            
        </ListGroup>

    )
}
